import logo from "./logo.svg";
import { YoutubeData } from "./YoutubeData";
import "./App.css";

/**
 * element = <div id = "root"> hello world</div>
 * element = React.createElement("div", {id: 'root'}, 'Hello world');
 *
 */

function App() {
  return (
    // children component
    <div className="youtube-item">
      {YoutubeData.map((item, index) => {
        let newClass = " ";
        if (index === 1) {
          newClass = "abc";
        }

        return (
          <Youtube
            key={item.id}
            image={item.image}
            avatar={item.avatar || item.image}
            title={item.title}
            author={item.author}
            // className={newClass}
          ></Youtube>
        );
      })}
    </div>
  );
}

function Youtube(props) {
  return (
    <div className={`youtube-item ${props.className}`}>
      <div className="youtube-img">
        <img src={props.image} alt="youtube" />
      </div>
      <div className="youtube-footer">
        <img src={props.avata} alt="" className="youtube-avatar" />

        <div className="youtube-info">
          <h3 className="youtube-title">
            {props.title || "This is example of title"}
          </h3>
          <h3 className="youtube-author">
            {props.author || "This is example of author"}
          </h3>
        </div>
      </div>
    </div>
  );
}

export default App;
